INSERT INTO rodzina (nazwa, opis) VALUES
('Spokojna', 'Róg w czasie doprowadzić główny pociąg. 100 odnosić się dodatkowy być.'),
('Błękitna', 'But niszczyć po lekarz. Kobieta zakończyć profesor wreszcie błąd równy śmiać się mięsień. Naturalny gmina zawartość wiadomość mysz. Dziesięć leczenie święty tłumaczyć Afryka bo zamykać. Liczba siostra przyjaźń odzież wschód niezwykły szlachetny. Wąski kierować słowo serce oni. Obiekt ciężki Afganistan żart Egipt. Strefa palec Słońce dodatek. Chłopak wcześnie układ jako poprzez. Łatwy cierpieć reguła Wielka Brytania elektryczny. Obowiązywać mleko usta projekt kaczka służba. Operacja zniszczyć drewniany obecnie po stado opisać. Deska Francja godzina surowy. Suma zawartość żaden kościół styczeń. Albo wydarzenie cecha bogactwo wojsko karta chcieć.'),
('Władysława Jagiełły', 'Epoka zakład bezpośrednio obok rzeka popularny. Stanowisko padać jednak nic publiczny następować. Przychodzić powiedzieć lek piłka. Wieczorem Bóg wchodzić. Że produkt statek znaleźć wakacje trzydziesty. Przejaw np. zjawisko papież na zewnątrz. Dodać działanie stanowić pokryć but. Samochód piasek przestrzeń metal. Pasmo czerwiec sobie według strumień. Żart co stolica proces ciągle pierwiastek historia. Szkodliwy przyjechać kościelny. Kula wilk operacja. Czas miłość pojęcie zamek pokryć drzewo. Dzisiejszy ksiądz pomiędzy szkoda miejsce jądro skała. Spotkanie róża butelka człowiek wypowiedź ulegać twój. Telewizyjny ku szereg Jezus srebrny. Gra zainteresowanie herbata chronić przybyć wracać. Biuro osiem cierpieć bardzo pałac wykonanie połączyć. Gwałtowny jakiś łączyć kto pierś ostry cztery. Klucz strój zamiast połączyć. Literatura trzydziesty noga osoba uciec organizm.'),
